import React from "react";

const bookingsControl = props => {
  return (
    <div className="bookings-control">
      <button onClick={props.changeOutput('list')}>List</button>
      <button onClick={props.changeOutput('chart')}>Chart</button>
    </div>
  )
}

export default bookingsControl;
